(3, 'Listo para entregar', '#17a2b8', 'Estimado cliente,\r\n\r\nNos complace informarle que su pedido está listo para ser entregado. Estaremos en camino para entregarlo lo antes posible. ¡Gracias por su compra!\r\n\r\nAtentamente,\r\n[Nombre de la empresa]'),
(4, 'Entregado', '#28a745', 'Estimado cliente,\r\n\r\nNos complace informarle que su pedido ha sido entregado satisfactoriamente. Esperamos que disfrute de sus productos y agradecemos su preferencia.\r\n\r\nAtentamente,\r\n[Nombre de la empresa]');
