INSERT INTO `politicas` (`idPol`, `nombrePol`, `desPol`, `estatus`) VALUES
(1, 'ninguno', 'ninguno', 5),
(5, 'Impresion rigidos', '1.-Archivo jpg no mayor a 25mb\n2.-Archivo en porcentaje del 10% tamaño real\n3.-Pago anticipado', 1),
(6, 'Politicas de Lona', 'LONA\n1.- ARCHIVO EN JPG O PDF\n(Cualquier otro formato podría causar modificaciones y sería bajo responsabilidad del cliente el dejarlo)\n2.- DISEÑO A LA MEDIDA\n(Sino esta a la medida, debe autorizar el cliente el deformarlo, sino está de acuerdo debe proporcionar el archivo correcto)\n3.- TRABAJADO EN CMYK\n(Si el archivo no tiene este modo de color, al momento de imprimir podrían variar los tonos, considerar que no se igualan colores, también considerar que si pide una impresión del mismo archivo en vinil y lona pueden variar los colores ya que son diferentes equipos)\n4.- RESOLUCIÓN A 300 DPIS\n(Si el archivo viene a 300dpis el archivo no debe medir más de 300x300cm ya sea que este a escala o no)\n5.- RESOLUCIÓN A 80DPIS\n(Si el archivo viene a 80dpis el archivo no debe estar a escala, debe ser el tamaño real)\n6.- TEXTOS PEQUEÑOS\n(Si el diseño tiene textos pequeños y/o delgados considerar que dependiendo su color de fondo pueden llegar a perderse o no ser muy legibles)\n7.- TEXTOS PEGADOS AL BORDE\n(Si los textos en tu diseño están muy pegados al borde de tu arte podrían llegar a taparse al momento de colocar los ojillos)\n8.- BORDES BLANCOS\n(Si envía su archivo con algún rebase blanco, indicar si así lo lleva o si se va a imprimir al raz de color del arte)\n9.- DURABILIDAD DE LA LONA\n(La duración de color en la impresión depende del lugar en donde se coloque la lona ya que el clima puede incluir en el desgaste de la misma. La mala manipulación de la lona puede maltratarla y dañar la impresión)\n¿CÓMO GUARDAR EL ARCHIVO?\n*Siempre guardar al tamaño Final de impresión\n*A 80dpis\n*En JPG\n*Si tiene áreas blancas al lo del diseño, poner un stroke en negro para delimitar el diseño.\n*indicar los acabados de la lona (considerar que algunos acabados pueden incrementar la medida del arte final)\n*Cuidar el peso final del archivo (máximo 20mb), ya que un archivo que este mas pesado podría no abrir en\nnuestros programas.\n\nNOTA:\nEl ancho del materiales de 320cm, si la lona rebásalos 315cm en X o Y, se debe partir en las partes que sean necesarias.\n\n\n\n\n¿CÒMO NOMBRAR ARCHIVOS DE LONA?\nBLANCA\nESTATUS, MEDIDA, CANTIDAD, NOMBRE, ACABADOS\nMATE/ MESH/ TRASLUCIDA\nESTATUS, MATERIAL, CANTIDAD, MEDIDA, NOMBRE, ACABADOS\nVINIL MICROPERFORADO\n(ESTE SE IMPRIME EN EL PLOTTER DE LONA)\nESTATUS, MATERIAL, CANTIDAD, MEDIDA, NOMBRE\nACABADOS\nLOS ACABADOS NORMALES SON BASTILLA Y OJILLOS CADA METRO APROPORCIÒN, A EXCEPCIÒN DE LA\nTRANSLUCIDA, LO NORMAL ES PARA TENSAR. CUANDO SE REQUERE DIFERENTE A LO NORMAL SE USA ALGUNO\nDE LOS SIGUIENTES ACRONIMOS:\nS-B: SE USA CUANDO LA LONA NO LLEVA OJILLOS\nP-T: SE USA CUANDO SE NECESITA UN ÀREA EXTRA DE LONA SIN ACABADOS QUE SIRVE PARA TENSAR\n(NORMALMENTE SON 8CM APROXIMADAMENTE)\nP-O: SE USA CUANDO EL CLIENTE NECESITA UN NUMERO ESPECIFICO DE OJILLOS DIFERENTES A LO NORMAL\nP-A: SE USA CUANDO LAS ESPECIFICACIONES SON MÀS COMPLEJAS, EJEMPLO, “BOLSAS”, “ OJILLOS Y ÀREA DE\nTENZADO”, “OJILLOS Y BOLSAS”......\nSIN ACABADOS: SE USA CUANDO NO SE REQUIEREN OJILLOS, NI BASTILLA, NI BOLSA, NI ÀREA DE TENZADO\nEJEMPLO:\nSI SOLO ES UNA BLANCA CON SERVICIO NORMAL Y ACABADOS NORMALES:\n100X100 FULANITO.JPG\nSI SON 2 LONA BLANCA IGUALES CON SERVICIO URGENTE Y ACABADOS ESPECIALES:\nURGE 2 100X100 FULANITOS S-B.JPG\nSI ES UNA LONA NO BLANCA CON SERVICIO NORMAL Y ACABADOS NORMALES:\nMESH 100X100 FULANITOS.JPG', 1),
(7, 'Políticas de corte de vinil', '1.- ARCHIVO VECTORIZADO\n(Cuidar que textos e imágenes estén vectorizadas)\n2.- DISEÑO A LA MEDIDA\n(48cm de ancho máximo para textil /58cm de ancho máximo en adhesivo)\n3.- ELEMENTOS PEQUEÑOS\n(Si el diseño tiene elementos pequeños y/o delgados, cuidar que no sean menores a 3mm de ancho y 2cm de alto, de lo contrario el corte puede levantarse y podría dañar nuestro equipo)\n4.- Verificar que el archivo este soldado y que no traiga trazos dobles (un archivo con relleno y contorno genera trazos dobles)\n\n\n¿CÓMO GUARDAR EL ARCHIVO?\n*Siempre especiar el tamaño final y en formato AI o EPS\n*Especificar color: poner el color de acuerdo al muestrario\n*Los viniles neón y glitter no se cortan\n*El vinil textil se entrega sin depilar.\n*Si su archivo pesa menos de 25MB mandar adjunto por correo y si sobrepasa ese peso por favor mandar por\nwetransfer ya que algunos enlaces de onedrive no permiten el acceso al archivo sin autorización.', 1),
(8, 'Grabado Laser ', 'El texto ó las imagenes que esten en curvas, no deben tener doble linea y se debe encontrar soldado todo\n-Diseño a la medida\nEn termos manejamos ancho maximo de 3.5cm\n-Eelementos pequeños\nLos textos no deben ser menores a 1mm de alto.\n\n\n¿Cómo guardar el archivo?\n-Especificar en que material se va a grabar\n-Especificar en que dirección hacer el grabado con los nombres (de abajo para arriba o inverso) si es horizontal\no vertical\n-Indicar medida del archivo\n-Si es libreta o algún objeto diferente especificar en que parte iría la impresión, considerando resortes, texturas o cualquier cosa en el producto seleccionado.\n*Si el cliente trae su propio materiales tiene riesgo de que no llegue a salir bien la impresión y no nos hacemos responsables del material.', 1),
(9, 'Politicas de Sellos ', '-Archivo en PDF vectorizado\n-Todo texto ó imagen debe estar en curvas\n-Diseño a la medida\n-Dependiendo el aparato a realizar y tomando en cuanta que se debe dejar por lo menos 1 mm de cada lado\n-Elementos pequeños\n-Textos no menores a 9pts y líneas no menores a 1.5pts, trazos no tan gruesos para que no se emplasten\n-Revisar que no tengan doble linea y que los elementos se encuentren soldados', 1),
(10, 'Impresión UV', '-Archivo en PDF o AI\nEl formato JPG ó PNG no son los ideales porque saldrían en impresión cada pixel que este por fuera del arte\n-Diseño a la medida 58x44cm\n-Trabajo en CMYK\nLos colores rojos bajarle 10% al magenta\nejemplo:\nRojo Rojo para UV\nC= 0 C=0\nM= 100 M=90\nY=100 Y=100\nK=0 K=0\nLas partes del diseño que tengan relleno blanco deberán estar compuesto con\nC= 1\nM=1\nY=1\nK=1\n-Resolución a 300 DPIS\n-Textos pequeños\nCuidar que no sean menores a 1mm y que no sean textos tan gruesos para que no se emplasten\n-Materiales Externos ó Internos\n-No se puede imprimir sobre vidrio, metal ó plásticos demasiados lisos\n-Botellas cónicas\n-Lake completamente negro\n¿Cómo guardar el archivo?\n-Especificar el modelo del aparato\n-A 300 DIPS\n-PDF a curvas ó AI\n-Si es libreta o algún objeto diferente especificar en que parte iría la impresión, considerando resortes, texturas\no cualquier cosa en el producto seleccionado.\n*Si el cliente trae su propio materiales tiene riesgo de que no llegue a salir bien la impresión y no nos hacemos\nresponsables del material.', 1),
(11, 'Políticas para Fotobotones  ', '-Archivo en JPG o PDF\nCualquier otro formato podría causar modificaciones y sería bajo responsabilidad del cliente dejarlo\n-Trabajado en CMYK\nSi el archivo no tiene este modo de color, al momento de imprimir podrían varear los tonos\n-Resolución a 300 DPIS\nPara una impresión de calidad\n-Tamaño del diseño 6.7cm\n-Área de seguridad y tamaño final del botón 5.5 cm\n**Si son diseños personalizados que sean archivos individuales o ya formados en la plantilla', 1),
(12, 'Vinil Corte a registro ', '*Archivos en PNG o PDF \n(cualquier otro formato podría causar modificaciones y seria bajo responsabilidad del cliente el dejarlo)\n*Diseño a la medida\n(las planillas son de 95x100 0 95x50)\n*Trabajo en CMYK\n(si el archivo no tiene este modo de color, al momento de imprimir podría varear los tonos )\n*Resoución a 300 dpis\n(si el archivo viene a menos de 300 dpis y tiene textos o detalles pequeños pueden no ser claros)\n*Textos pequeños\n(si el diseño tiene textos pequeños y/o delgados cuidar que no sean menores a 5 mm, cuando están sobre color, o menos de 3 mm sobre fondo blanco, menor a eso pierden definición y legibilidad)\n\n\nFormas del corte\n-EXTERNO\nse corta 3mm después del diseño\n1cm de separación entre cada diseño hacia todos los lados\n-INTERNO\nse corta 3mm dentro del diseño\n0.5cm de separación entre cada diseño hacia todos los lados, considerando la medida final\ndel diseño\n\n¿Cómo guardar el archivo?\nespecificar material : mate, brillante, transparente\nsiempre especificar: cantidad, medida y nombrar\n\n', 1),
(13, 'Políticas de Credenciales de PVC', '*Archivo en JPG o PDF \n(Cualquier otro formato podría causar modificaciones y sería bajo responsabilidad del cliente el dejarlo)\nArchivos individuales en JPG si son muchos\n*Diseño a la medida\n(si no esta a la medida, debe autorizar el cliente el deformarlo, sino esta de acuerdo debe proporcionar el archivo correcto)\n*Trabajado en CMYK\n(si el archivo no tiene este modo de color, al momento de imprimir podría varear los tonos)\n*Resolución a 300dpis\n(para una impresión de calidad)\n*Tamaño del diseño\n6.5x9.5cm \n*Tamaño final de la credencial\n5.5x8.5 cm\n*Área de seguridad\n4.8x7.8cm\n*Considerar no dejar texto tan pegado arriba si llevan perforación\n\n\n¿Cómo guardar el archivo?\nsiempre guardar en JPGal tamaño final de impresión a 300dpis\nguardar en carpeta, nombrado con la cantidad de credenciales, especificar si es f y v o solo f y si llevan o no perforaciones, tipo de perforación\nnombrar indicando fyv, ejemplo: aldo f.jpg - aldo v.jpg\n', 1),
(14, 'Politicas de Offet', '*Archivo en JPG o PDF\n(cualquier otro formato podría causar modificaciones y sería bajo responsabilidad del cliente el dejarlo)\n*Trabajado en CMYK\n(si el archivo no tiene este modo de color, al momento de imprimir podrían varear los tonos)\n*Resolución a 300dpis\n(para una impresión de calidad)\n*Tamaños del diseño\n-tarjetas 9x4.8\n-volantes 1-4 9.7x13.6\n-volantes 1-2 19.7x13.6\n-volantes 1-3 19.7x9.1\n-separador 4.8x18.3\n-postalmini 9.7x9\n-postalch 9x14.7\n-postalgde 9x16.4\n-tabloide 27.5x39.7\n-carta 19.5x27.5\n-4cartas 55.3x39.7\n-8cartas 79.7x55.3\n(sino cumple con el tamaño, el cliente debe autorizar la deformación o proporcionar el archivo correcto)\n*colores con 3 tintas\n(el color no debe estar compuesto por más de 3 tintas (CMYK), de lo contrario la carga de tinta puede generar manchas y presentar visibles desfaces)\n*Negros\nel negro profundo se compone por cmy:40% y k: 100% (solo para fondos y plastas grandes)\nelementos delgados y pequeños como textos, iconos y códigos QR solo deben tener k:100%\n*Textos\nel tamaño de texto mas pequeño recomendado es de 10pts, si este esta sobre un fondo\nnegro profundo debe tener un stroke de 1 0 2pts de pura tinta k:100% para protegerlo y no\nse lo coma la tinta\n\n¿Cómo guardar archivos?\nsiempre guardar al tamaño final de impresión en JPG a 300dps\nindicar cantidad, que tamaño es, si es 4x0, 4x1 o 4x4 y el frente y la vuelta, ejemplo:\ntarj 4x1 nombre f.jpg - tarj 4x1 nombre v.jpg\n', 1),
(15, 'Políticas de Impresión DTF ', '\n*Archivo en PNGo PDF\n(de preferencia en PDF, de esta forma es posible trabajarlo en CMYK)\n*Trabajado en CMYK\n(si el archivo no tiene este modo de color, al momento de imprimir podrían varear los tonos,\nel archivo se debe guardar en CMYK)\n*Resolución a 300dpis\n(menor a 300dpis la calidad va disminuyendo)\n*Cuidar opacidad\n*Transparencias y degradados\n(donde hay pixel aún con opacidad del 1% saldrá en la impresión con pasta blanca, también los degradados de color a transparencia salen con plasta blanca atrás )\n*Líneas delgadas, textos pequeños corren el riesgo de no salir o mp adherirse al planchar, pues lo delgado no permite que tengan tanta poliamida\n\n¿Cómo guardar el archivo?\nsiempre guardar al tamaño real de la impresión\na 300dpis\nagregar canala de tinta plana “w1” en tiff\nNOTA:\nel ancho del material es de 58cm y evitar exceder los 2.5m de largo para evitar que el archivo se vuelva muy pesado\n', 1),
(16, 'Políticas ColorMake', 'Le agradecemos su confianza al adquirir nuestros equipos y productos. Color Make™ informa que todos los equipos y/o prensas de la marca Color Make™ tienen una garantía de 2 años (aplican excepciones), Excepto los equipos SMART HEAT de 38×38 cm y 40×60 cm, los cuales cuentan con 3 años de garantía, contados a partir de la fecha de facturación al consumidor, comprobable con la respectiva factura de compra, contra cualquier defecto de fabricación y funcionamiento durante el uso normal de los equipos. Estas garantías amparan únicamente al equipo indicado en la factura.\n\nCláusulas de Garantía\n\n.-Esta garantía ampara únicamente equipos comercializados por Color Make™ y sus Distribuidores autorizados.\n.-Contaran con dos años de garantía todas las partes de su equipo, a excepción de las resistencias de calor, las cuales poseen un año de garantía y los equipos Smart Heat de 38×38 cm y 40×60 cm los cuales cuentan con 3 años de garantía.\n.-La garantía no es transferible.\n.-Si al momento de realizar la compra registra su equipo en nuestra página web *https://soporte.colormake.com/* durante los primeros 30 días naturales posteriores a la fecha de factura, se le otorgará gratuitamente una extensión de 3 meses en su garantía (no aplica para la resistencia de calor)\n.-Para hacer efectiva la garantía, inicialmente debe registrar su equipo en la sección soporte, y después reportar la falla para generar un ticket con su número de caso y así poder ayudarlo con la verificación y diagnóstico del mismo\n.-Para el registro del equipo es indispensable contar con factura, la cual puede ser adjunta en PDF o como una foto donde toda la información sea legible. Notas o tickets de venta no serán válidos como comprobante de compra. En caso de adjuntar fotografía de la factura no legible, al solicitar una garantía se le requerirá nuevamente la información; de no poder proporcionar la información al equipo de soporte, Color Make™ se reservará el derecho de no ofrecer el servicio de garantía debido a que no se podrá validar la información de compra.\n.-La aplicación de las garantías de todos nuestros productos está sujeta a la verificación y diagnóstico del producto en cuanto a su funcionamiento, componentes, características y factura original de compra.\n.-Color Make™ acepta reparar durante el período de garantía aquellos productos que presenten daños durante su uso normal, de acuerdo con las instrucciones del manual de usuario y el propósito para el cual el equipo fue diseñado.\n.-Si el equipo se encuentra dentro del periodo de garantía, Color Make ™ se compromete a reparar o reponer las piezas y componentes defectuosos del mismo (si aplica la garantía), sin costo alguno para el propietario.\n.-Los gastos de envío por garantía del equipo averiado a nuestro centro de servicio autorizado estarán a cargo de Color Make™ únicamente los primeros 15 días hábiles posteriores a la fecha de factura de compra del equipo, posterior a esto el envío del equipo estará a cargo del cliente. Esta cláusula de envío gratuito los primeros 15 días hábiles sólo aplica en países donde Color Make ™ posea centro de servicio autorizado.\n.-El tiempo de reparación no será mayor a sesenta días naturales, a partir de la fecha de recepción del producto o equipo por parte de nuestro centro de servicio autorizado.\n.-Color Make™ no se hace responsable de equipos reparados dejados en abandono después de transcurridos los sesenta días naturales de haberse notificado su reparación.\n.-Pierden garantía los equipos alterados o reparados por personal no autorizado por Color Make™\n.-Pierden garantía los equipos dañados por mala operación o por instalación eléctrica defectuosa, así como variaciones de voltajes o la ausencia de protector de voltaje en las máquinas que lo requieran.\n.-De no contar con un centro de servicio autorizado en el país donde usted se encuentra, Color Make™ se compromete a prestarle asesoría en línea para identificar la falla, reponer las respectivas piezas de repuesto (de ser necesario) y mostrar la instalación de estas mediante videos en nuestro canal de YouTube. Favor tomar en cuenta que el costo de envío de la pieza a reemplazar estará a cargo del cliente en este caso.\n.-Color Make ™ se reserva el derecho de actualizar sus políticas de garantía en cada país, se requiere que lea nuestras políticas actualizadas ubicadas en esta página web o mediante la lectura del código QR aquí señalado en las cajas de los equipos.\n\n\nGarantía equipos DTF\n\nApreciable Cliente:\nLe agradecemos su confianza al adquirir nuestros equipos y productos. Color Make® se compromete a hacer de su compra una experiencia grata, y para eso no comprometemos a que:\n\n.-Una vez, que haya concluido su compra, se agendará una cita para que nuestros Técnicos le instalen el equipo, el desempacado y armado del equipo solo podra ser efectuado por tecnicos autorizados de Color Make® .\n.-Nuestros técnicos, realizarán el registro de su equipo de impresión, en nuestra página oficial.\n.-Se entregará el equipo instalado y 100% funcionando.\n.-El equipo se entrega con cabezales testeados y en correcto funcionamiento de inyección e impresión.\n.-Se entregarán los perfiles de color adecuados a su equipo (En caso de que el cliente requiera de un perfil especial, deberá informarlo a nuestro técnico, para que tome las medidas necesarias). Perfiles especiales al gusto del cliente no estan icluidos, pero podran realizarse con un costo extra.\n\nColor Make®, se compromete a mantener asesorías continuas con nuestros clientes, las cuales serán agendadas con nuestros técnicos para poder ofrecerle un servicio de calidad, mismas que podrán realizarse utilizando los medios electrónicos y digitales.\n.-Color Make® informa que nuestros Sistemas de Impresión por sublimación, ecosolvente o DTF (Plotter) de la marca Color Make® tienen una garantía de 18 dieciocho meses (Aplican restricciones, de acuerdo a las cláusulas, que más adelante se detallan) contados a partir de la fecha de facturación al consumidor, comprobable con la respectiva factura de compra, contra cualquier defecto de fabricación y funcionamiento siempre y cuando se dé el uso adecuado a dichos equipos. Estas garantías amparan únicamente al equipo indicado en la factura.\n\n\nCláusulas de Garantía\n\n.-Esta garantía ampara únicamente a los Sistemas de Impresión de sublimación (Plotter) y/o sistema de impresión DTF comercializados por Color Make®.\n.-Contaran con 18 meses de garantía todas las partes de su equipo, a excepción de los cabezales, bajo las siguientes condiciones:\n.-Para que el equipo de impresión se mantenga en buenas condiciones, se deberá hacer limpieza de cabezales e imprimir por lo menos cada tres días con todos los colores (C, M, Y, K, W), con esto se evitará que los cabezales puedan taparse, dañando el correcto funcionamiento del equipo, en caso de no imprimir y realizar la limpieza de cabezales esto pondria en riesgo los cabezales los cuales por tal motivo no estarian cubiertos por la garantia.\n.-Durante el tiempo de garantía de la máquina, única y exclusivamente deberán usarse consumibles de la línea Color Make®, adquiridos directamente con nosotros, en caso de usarse otro tipo de consumibles, se dará por terminada inmediatamente la garantía del equipo, puesto que nuestros productos cuentan con la calidad requerida para el correcto funcionamiento de los equipos de impresión.\n.-El cliente deberá comprar durante la vigencia de la garantía, productos de la línea Color Make®, por lo tanto, si el cliente deja de adquirir productos de la línea Color Make® por más de 45 días, dejará de aplicar la garantía en los Sistemas de Impresión de sublimación (Plotter) y/o sistema de impresión DTF, con esto se garantiza que la máquina use productos de calidad que no dañen las partes de los equipos, (Los equipos de impresión de tamaño pequeño y mediano requieren por mínimo de 2 a 3 kits básicos de impresión; los equipos de tamaño grande, requieren de un mínimo de 3 a 5 kits) que deberan ser adquiridos durante estos periodos. El cliente, debe mantener un archivo y/o reporte de impresiones y limpieza de cabezales, que deberá proporcionar a nuestros técnicos en caso de ser necesario.\n.-La garantía no es transferible.\n.-Para ser sujeto de garantía le solicitamos exigir a nuestro técnico instalador que registre su equipo en nuestra página web *https://soporte.colormake.com/* durante la instalación de su equipo.\n.-En caso de daños o fallos técnicos, el cliente deberá informar de inmediato a Color Make®, debido a que los cabezales pueden taponarse y causar un daño grave al equipo de impresión.\n.-Para hacer efectiva una solicitud de reparación por garantía, inicialmente debe solicitar un soporte y generar un ticket describiendo el problema en colormake.com en la sección lo mas buscado/soporte, y reportar la falla para generar un ticket con su número de caso y así poder ayudarlo con la verificación y diagnóstico del mismo.\n.-Para solicitar soporte de los Sistemas de Impresión de sublimación o ecosolvente (Plotter) y/o sistema de impresión DTF es indispensable contar con factura, la cual puede ser adjunta en PDF o como una foto donde toda la información sea legible. Notas o tickets de venta nose harán válidos como comprobante de compra. En caso de adjuntar fotografía de la factura no legible, al solicitar una garantía se le requerirá nuevamente la información; de no poder proporcionar la información al equipo de soporte, Color Make® se reservará el derecho de no ofrecer el servicio de garantía debido a que no se podrá validar la información de compra.\n.-La aplicación de las garantías de todos nuestros productos está sujeta a la verificación y diagnóstico del producto en cuanto a su funcionamiento, componentes, características, manejo adecuado y factura original de compra.\n.-Color Make® acepta reparar durante el período de garantía aquellas partes que presenten daños durante su uso normal, de acuerdo con las instrucciones que le proporcionen nuestros técnicos y el propósito para el cual el equipo fue diseñado y en las condiciones señaladas con anterioridad.\n.-Si el equipo se encuentra dentro del periodo de garantía, Color Make® se compromete a reparar o reponer las piezas y componentes defectuosos del mismo (si aplica la garantía), sin costo alguno para el propietario.\n.-Debido al gran tamaño de estos equipos normalmente las reparaciones en la mayoria de los casos se realizan en el taller o imprenta del cliente, , Color Make® puede enviar las partes y mediante una video conferencia guiar al cliente en la instalacion de la misma, si se presentara la necesidad de enviar un tecnico al cliente (sólo aplica en países donde Color Make® posea centro de servicio autorizado),  en caso de que la garantia este vigente y no haya sido daño por mal uso, las partes o repuestos seran cubiertas por Color Make®. El traslado de los técnicos y viáticos deberan ser cubiertos por el cliente.\n.-El tiempo de reparación no deberá ser mayor a 15 quince días naturales en zonas céntricas del país y 30 treinta días naturales en zonas lejanas (A menos que existan casos excepcionales, que no permitan cumplir estos tiempos), a partir de la fecha de recepción del producto o equipo por parte de nuestro centro de servicio autorizado (En cualquier caso, se deberán atender las indicaciones que nuestros técnicos le hagan para evitar daño en cabezales o en el equipo en general).\nSi se llegaran a requerir piezas que no tengamos en existencia, deberá el cliente esperar a que el pedido llegue a nuestros almacenes.\n\n.-Pierden garantía los equipos alterados o reparados por personal no autorizado por Color Make®\n.-Pierden garantía los equipos dañados por mala operación o por instalación eléctrica defectuosa, así como variaciones de voltajes o la ausencia de protector de voltaje en las máquinas que lo requieran.\n.-De no contar con un centro de servicio autorizado en el país donde usted se encuentra, Color Make® se compromete a prestarle asesoría en línea para identificar la falla, reponer las respectivas piezas de repuesto (de ser necesario), mostrar la instalación de estas mediante videos, o probar que cuenta con un Agente Autorizado. Favor tomar en cuenta que el costo de envío de la pieza a reemplazar estará a cargo del cliente en este caso.\n.-Color Make® se reserva el derecho de actualizar sus políticas de garantía en cada país, se requiere que lea nuestras políticas actualizadas ubicadas en nuestra página web colormake.com\n \n\nComo anteriormente se menciona, el equipo de impresión se entregará con cabezales testeados y en correcto funcionamiento, por lo que corresponde al cliente darle el uso adecuado y sus limpiezas e impresiones de rutina (utilizando todos los colores C, M, Y, K, W, los cabezales solo son garantizados contra defectos de fábrica, el taponamiento del mismo por mal uso o descuido en los tiempos para su limpieza e impresión constante es responsabilidad del usuario, por lo que le recomendamos cuidar de ellos, dando seguimiento a todas las instrucciones que nuestros Técnicos le proporcionen y a las que se incluyen a lo largo de ésta póliza de garantía.\n\nSe tiene que realizar mantenimiento general de sus equipos, por menos cada 6 seis meses para una mejor operatividad, por un Técnico autorizado de Color Make®, así mismo al año de funcionamiento se debe realizar un mantenimiento más a fondo, en ambos casos el costo estará a cargo del cliente\n\nNota: Nuestros Técnicos, podrán realizar videos, entrevistas, fotografías llenado de reportes y los demás de considere necesarios para evidenciar el correcto funcionamiento de los equipos, le agradeceremos pueda otorgarle los medios para el correcto desempeño de sus labores.\n', 1),
(17, 'Políticas de Sublimación ', '1.- ARCHIVO EN JPG O PDF\n(Cualquier otro formato podría causar medicaciones y sería bajo responsabilidad del cliente el dejarlo. Si su\narchivo viene en PDF favor de incrustar las imágenes para que no salga el espacio en blanco)\n2.- DISEÑO A LA MEDIDA\n(Sino esta a la medida, debe autorizar el cliente el deformarlo, sino está de acuerdo debe proporcionar el\narchivo correcto)\n3.- TRABAJADO EN CMYK\n(Si el archivo no tiene este modo de color, al momento de imprimir podrían variar los tonos sobre todo\nen este sistema de impresión, considerar que no se igualan colores)\n4.- RESOLUCIÓN A 300 DPIS\n(Se recomienda que todos sus archivos sean mandados a 300DPIS de resolución de lo contrarío podría bajar la\ncalidad de su impresión)\n5.- PRODUCTOS ESPECIALES\n(Solicitar por correo o en mostrador las plantillas para que pueda deformar sus diseños)\n6.- ESPECIFICACIONES\n(Dependiendo del trabajo/material especificar en donde va a ir impreso, por ejemplo en tazas indicar si es frente,\ncentrado o atrás)\n7.- MATERIALES EXTERNOS\n(Considerar que cuando traen material ajeno a nosotros tendría que ser para sublimar y no nos hacemos responsables\npor el mismo)\n¿CÓMO GUARDAR EL ARCHIVO?\n*Siempre guardar al tamaño de impresión\n*A 300dpis\n*En JPG o PDF\n*Si tiene áreas blancas al lo del diseño, no poner un stroke de ningún color para delimitar el diseño ya podría salir impreso\nen el producto.', 1),
